pipeline {
    agent any
    options {
        buildDiscarder(logRotator(numToKeepStr: "10", artifactNumToKeepStr: "1"))
    }
    stages {
        stage("Setup") {
            steps {
                git(
                    url: "git@github.com:mickael-kerjean/filestash",
                    branch: "master"
                )
                dir("test") {
                    git(
                        url: "git@github.com:mickael-kerjean/filestash-test.git",
                        credentialsId: "github-com-filestash-test",
                        branch: "main"
                    )
                }
            }
        }
        stage("Build") {
            steps {
                script {
                    docker.image("node:14").inside("--user=root") {
                        sh "apt update -y && apt install -y brotli"
                        sh "npm install"
                        sh "make build_frontend"
                    }
                    docker.image("golang:1.23-bookworm").inside("--user=root") {
                        // prepare: todo - statically compile plg_image_c so we don't have to do this to pass the e2e tests
                        sh "sed -i 's|plg_image_c|plg_image_golang|' server/plugin/index.go"
                        // build
                        sh "go get ./..."
                        sh "go generate -x ./server/..."
                        sh "CGO_ENABLED=0 go build -o dist/filestash cmd/main.go"
                    }
                }
            }
        }
        stage("Test") {
            steps {
                script {
                    // smoke test
                    docker.image("golang:1.23-bookworm").inside("--user=root") {
                        sh 'timeout 5 ./dist/filestash > access.log || code=$?; if [ $code -ne 124 ]; then exit $code; fi'
                        sh "cat access.log"
                        sh "cat access.log | grep -q \"\\[http\\] starting\""
                        sh "cat access.log | grep -q \"listening\""
                        sh "cat access.log | grep -vz \"ERR\""
                    }
                    // test frontend old
                    docker.image("node:14").inside("--user=root") {
                        sh "cd ./test/unit_js && npm install"
                        sh "cd ./test/unit_js && npm test"
                    }
                    // test frontend new
                    docker.image("node:20").inside("--user=root") {
                        sh "cd public && npm install"
                        // sh "cd public && npm run lint"
                        sh "cd public && npm run check"
                        // sh "cd public && npm run test"
                    }
                    // test backend
                    docker.image("golang:1.23-bookworm").inside("--user=root") {
                        sh "cp ./test/assets/* /tmp/"
                        sh "go generate ./test/unit_go/..."
                        sh "go get ./..."
                        sh "go test -count=1 \$(go list ./server/... | grep -v \"server/plugin\" | grep -v \"server/generator\")"
                    }
                    // test e2e
                    docker.image("machines/puppeteer:latest").inside("--user=root") {
                        sh "cd ./test/e2e && npm install"
                        sh "chmod +x ./dist/filestash"
                        sh "./dist/filestash > /dev/null &"
                        sh "cd ./test/e2e && node servers/webdav.js > /dev/null &"
                        // sh "cd ./test/e2e && npm test"
                    }
                }
            }
        }

        stage("Release") {
            steps {
                // amd64
                sh "docker build --no-cache -t machines/filestash:latest-amd64 ./docker/"
                sh "docker push machines/filestash:latest-amd64"

                // // arm
                // sh "docker buildx build --platform linux/arm64 -t machines/filestash:latest-arm64 ./docker/"

                // create final image
                sh "docker manifest rm machines/filestash:latest || true"
                // sh "docker manifest create machines/filestash:latest --amend machines/filestash:latest-amd64 --amend machines/filestash:latest-arm64v8"
                sh "docker manifest create machines/filestash:latest --amend machines/filestash:latest-amd64"
                sh "docker manifest push machines/filestash:latest"
            }
        }

        stage("Deploy") {
            steps {
                sh "kubectl rollout restart deployment app-filestash-demo -n filestash"
            }
        }
    }
    post {
        always {
            cleanWs()
        }
    }
}

package embed

import (
	"embed"
	"io/fs"
	"net/http"
	"os"
)

var (
	//go:embed public
	wwwPublic embed.FS
	WWWPublic http.FileSystem = http.FS(os.DirFS("./public/"))
)

//go:embed server/plugin/index.go
var EmbedPluginList []byte

func init() {
	if os.Getenv("DEBUG") != "true" {
		fsPublic, _ := fs.Sub(wwwPublic, "public")
		WWWPublic = http.FS(fsPublic)
	}
}

const webpack = require("webpack");
const path = require("path");
const HtmlWebpackPlugin = require("html-webpack-plugin");
// const BundleAnalyzerPlugin = require("webpack-bundle-analyzer").BundleAnalyzerPlugin;
const UglifyJSPlugin = require("uglifyjs-webpack-plugin");
const CopyWebpackPlugin = require("copy-webpack-plugin");
const CompressionPlugin = require("compression-webpack-plugin");

const config = {
    entry: {
        app: path.join(__dirname, "client", "index.js"),
    },
    output: {
        path: path.join(__dirname, "server", "ctrl", "static", "www"),
        publicPath: "/",
        filename: "assets/js/[name]_[chunkhash].js",
        chunkFilename: "assets/js/chunk_[name]_[id]_[chunkhash].js",
    },
    module: {
        rules: [
            {
                test: path.join(__dirname, "client"),
                use: ["babel-loader"],
                exclude: /node_modules/,
            },
            {
                test: /\.html$/,
                use: "html-loader",
            },
            {
                test: /\.woff2$/,
                use: "woff-loader",
            },
            {
                test: /\.scss$/,
                use: [
                    { loader: "style-loader" },
                    { loader: "css-loader" },
                    { loader: "sass-loader" },
                ],
            },
            {
                test: /\.css$/,
                use: [
                    { loader: "style-loader" },
                    { loader: "css-loader" },
                ],
            },
            {
                test: /\.(pdf|jpg|png|gif|svg|ico|woff|woff2|eot|ttf)$/,
                loader: "url-loader",
            },
            {
                test: /[a-z]+\.worker\.js$/,
                loader: "worker-loader",
                options: { name: "assets/js/[name]_[hash].js" },
            },
        ],
    },
    plugins: [
        new webpack.DefinePlugin({
            "process.env.NODE_ENV": JSON.stringify(process.env.NODE_ENV),
        }),
        new HtmlWebpackPlugin({
            template: path.join(__dirname, "client", "index.html"),
            inject: true,
            minify: {
                collapseWhitespace: true,
                removeComments: true,
                minifyJS: true,
                minifyCSS: true,
            },
        }),
        new CopyWebpackPlugin([
            { from: "locales/*.json", to: "assets/" },
            { from: "worker/*.js", to: "assets/" },
            { from: "assets/logo/*" },
            { from: "assets/img/*" },
            { from: "assets/icons/*" },
            { from: "assets/fonts/*" },
        ], { context: path.join(__dirname, "client") }),
        new CopyWebpackPlugin([
            { from: "node_modules/pdfjs-dist/build/*.js", to: "assets/vendor/" },
            { from: "node_modules/pdfjs-dist/cmaps/*", to: "assets/vendor/" },
        ]),
        // new BundleAnalyzerPlugin()
    ],
    resolve: {
        fallback: {
            "path": require.resolve("path-browserify"),
            "crypto": require.resolve("crypto-browserify"),
            "buffer": require.resolve("buffer/"),
            "stream": require.resolve("stream-browserify"),
            "vm": require.resolve("vm-browserify"),
        },
    },
    mode: process.env.NODE_ENV || "production",
};


if (process.env.NODE_ENV === "production") {
    // config.plugins.push(new UglifyJSPlugin({
    //     sourceMap: false,
    //     extractComments: true,
    // }));
    config.plugins.push(new CompressionPlugin({
        asset: "[path].gz[query]",
        algorithm: "gzip",
        test: /\.js$|\.json$|\.html$|\.svg|\.ico$/,
        threshold: 0,
        minRatio: 0.8,
    }));
    config.plugins.push(new CompressionPlugin({
        asset: "[path].br[query]",
        algorithm: "brotliCompress",
        test: /\.js$|\.json$|\.html$|\.svg|\.ico$/,
        threshold: 0,
        minRatio: 0.8,
    }));
} else {
    config.devtool = "inline-source-map";
}

module.exports = config;
